'''Tynan''' is the owner of [[Tynan's Fishing Supplies]] in [[Port Piscarilius]]. He is found in his [[fishing shop]] due north-east off the docks. He is seen wearing a [[white apron]] and a green cap. He sells empty [[bucket]]s, [[Small fishing net|small]] and [[big fishing net]]s, [[fishing rod]]s, [[harpoon]]s, [[lobster pot]]s, [[bait]], and [[sandworms]], which the latter is used to catch [[anglerfish]].

At 30% [[Port Piscarilius|Piscarilius]] [[favour]] and level 15 [[Hunter]] or above, players can aid him in collecting [[buckets of sandworms]] off the beach. Players will need a [[spade]] and empty buckets to perform this activity.

